import axios from "axios";
const Home = (dispatch) => {
  axios.get("https://jsonplaceholder.typicode.com/posts") .then((response) => {
    dispatch({ type: 'Home', payload: response.data });
  })
  .catch((error) => {
    console.error('Error fetching data:', error);
  });
};

export default Home;
